import React from 'react'

function Tarjeta({reyes}) {
const reyesFiltrados = reyes.filter(e => e.vacasComidas >= 10);
const resultado = reyesFiltrados.map(valor => {
  <div>valor.nombre
    <button></button>
  </div>
})
  return (
    <div>
      {resultado}
    </div>
  );
}

export default Tarjeta
